import React, { useState } from "react";

const NavBar = () => {
  return (
    <>
      <nav class="bg-principal-color">
        <div class="grid grid-cols-4 gap-4">
          <div>Home</div>
          <div>About us</div>
          <div>Features</div>
          <div>Contact us</div>
        </div>
      </nav>
    </>
  );
};

export default NavBar;
